import React, { useState } from 'react';

const VendorPage = () => {
  const [formData, setFormData] = useState({
    contactName: '',
    businessName: '',
    email: '',
    phoneNumber: '',
    website: '',
    productsServices: '',
    itemsList: '',
    electricityRequired: false,
    staffCount: 0,
    hasDigitalPayment: false,
    acceptedTerms: false,
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission, e.g., send data to server
    console.log(formData);
  };

  return (
    <div>
      <h1>Registration Form</h1>
      <form onSubmit={handleSubmit}>
        <label>
          Contact Name:
          <input
            type="text"
            name="contactName"
            value={formData.contactName}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Business Name:
          <input
            type="text"
            name="businessName"
            value={formData.businessName}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Email:
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Phone Number:
          <input
            type="tel"
            name="phoneNumber"
            value={formData.phoneNumber}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Website:
          <input
            type="url"
            name="website"
            value={formData.website}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Products or Services Offered:
          <textarea
            name="productsServices"
            value={formData.productsServices}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          List of Items to be Sold:
          <textarea
            name="itemsList"
            value={formData.itemsList}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Do you require electricity at your stand?
          <input
            type="checkbox"
            name="electricityRequired"
            checked={formData.electricityRequired}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          How many staff will you bring?
          <input
            type="number"
            name="staffCount"
            value={formData.staffCount}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Do you have a digital payment system for your business?
          <input
            type="checkbox"
            name="hasDigitalPayment"
            checked={formData.hasDigitalPayment}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          <input
            type="checkbox"
            name="acceptedTerms"
            checked={formData.acceptedTerms}
            onChange={handleChange}
          />
          I have read and accepted the terms and conditions
        </label>
        <br />
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default VendorPage;
